import styled from 'styled-components'

function Card({ item }) {
    return (
        <div>
            <div>{item.name}</div>
            <div>{item.raiting}</div>
            <div>{item.released}</div>
            <div>{item.name}</div>
        </div>
    )
}

export default Card
